content: >-
  <p class="p"><span data-number="9" data-sid="ZEC 5:9" class="v">9</span>Then
  lifted I up mine eyes, and looked, and, behold, there came out two women, and
  the wind <span class="add">was</span> in their wings; for they had wings like
  the wings of a stork: and they lifted up the ephah between the earth and the
  heaven. </p>
